import React from 'react';
import styled from 'styled-components';
import { Helmet } from 'react-helmet';
import AboutUs from './AboutUs';
import Services from './Services';
import Testimonials from './Testimonials';
import BlogH from './Blog';
import ContactUs from './ContactUs';

const Intro = styled.div`
  /* Add your styles for Intro section */
`;

const Story = styled.div`
  /* Add your styles for Story section */
`;

const Team = styled.div`
  /* Add your styles for Team section */
`;

const CallToAction = styled.div`
  /* Add your styles for CallToAction section */
`;

const SEO = styled.div`
  /* Add your styles for SEO section */
`;

const Home = () => {
  return (
    <div>
      <Helmet>
        <title>Welcome to TechBitz - Your One-Stop Digital Solution</title>
        <meta name="description" content="Embrace the future of digital with TechBitz. We offer comprehensive solutions in Digital Marketing, Web Design & Development, SEO, and Advertisement." />
        {/* Add your keywords here */}
      </Helmet>

      <Intro>
        <h1>Welcome to TechBitz</h1>
        {/* Continue with the rest of your Intro content */}
      </Intro>

      <Services />

      <Story>
        {/* Add your Our Story content here */}
      </Story>

      <Team>
        {/* Add your Meet the Team content here */}
      </Team>

      <Testimonials />

      <Blog />

      <CallToAction>
        {/* Add your Call to Action content here */}
      </CallToAction>

      <ContactUs />

      <SEO>
        {/* Add your SEO content here */}
      </SEO>
    </div>
  );
}

export default Home;
